CREATE DATABASE jokesapi;
USE jokesapi;

CREATE TABLE jokes (
id SMALLINT UNSIGNED PRIMARY KEY,
type VARCHAR(50) DEFAULT "general",
setup TINYTEXT NOT NULL,
punchline TINYTEXT NOT NULL,
likes SMALLINT DEFAULT 0
);

